children.defaultValue:
React.forwardRef((props, ref) => {
  const { styles, title, className, children, html } = props

  const elementProps = Object.assign({}, props)
  delete elementProps.styles
  delete elementProps.html
  delete elementProps.children

  return React.createElement(
    html ? html : 'div',
    {
      ...elementProps,
      className: `${renderTailwind(styles)} ${className ? className : ''}`,
      'aria-label': title,
      alt: title,
      ref
    },
    children
  )
})
